    false,nt"url": null,nt"notes": "Preliminary proposal and work plan for
    the project "Evaluation of Black-billed Magpies as Indicators of Environmental
    Contamination at the Rocky Mountain Arsenal". The purpose of this investigation
    is to evaluate black-billed magpies as biomonitors of environmental contamination
    at RMA. Because little is known about magpie responses to contaminants, this study
    will collect baseline data on exposure pathways, exposure levels, and demographic,
    reproductive, and behavioral responses of magpies. This data will be used in the
    design of a long-term biomonitoring program using black-billed magpies. While dieldrin
    will be 7 possible, the major analyte of concern, I will evaluate exposure and responses
    to other COC's when.This research is scheduled to be conducted for three full field
    seasons. In 1995, research will focus on collecting baseline demographic, reproductive,
    and behavioral data and collecting samples for contaminant analysis. In addition,
    1995 will be used as a pilot season for the development and evaluation of field
    techniques and sampling efficiency.",nt"license_title": "License Not Specified",nt"extras":
